import styled from "styled-components";

export const Menu = styled.nav`
    width: 100%;
    height: 3rem;
    display: flex;
    align-items: center;
    padding: 15px 35px; 
    justify-content: space-between;

    ul{
        display:flex;
        gap: 40px;
        list-style: none;

    }

`;

export const InputBox = styled.form`
    input{
        border: none;
        background-color: transparent;
    }
`;
